INSERT INTO `page` VALUES (1,'Prsentation du club','<h1><span style=\"font-family:Georgia,serif\">Le club</span></h1>\r\n\r\n<p style=\"margin-left:40px\"><span style=\"font-family:Georgia,serif\"><img alt=\"\" src=\"/data/phototheque/vds.jpg\" style=\"height:147px; width:340px\" /></span></p>\r\n\r\n<p style=\"margin-left:40px\"><span style=\"font-family:Georgia,serif\">L&#39;Amicale du Val de Somme&nbsp;est un club de course &agrave; pied, cr&eacute;e en 1984, situ&eacute;e &agrave; Amiens et affili&eacute;e &agrave; la F&eacute;d&eacute;ration Fran&ccedil;aise d&#39;Athl&eacute;tisme (FFA).</span></p>\r\n\r\n<p style=\"margin-left:40px\"><span style=\"font-family:Georgia,serif\">L&#39;Amicale du Val de Somme permet aux coureurs sur route de&nbsp;tous niveaux&nbsp;(jogger du dimanche, d&eacute;butants, coureurs confirm&eacute;s, ...) de se regrouper au sein d&#39;une amicale ou chacun vient&nbsp;courir librement, sans obligation de participer &agrave; des entra&icirc;nements ou des comp&eacute;titions, afin d&#39;entretenir des relations d&#39;amiti&eacute; et de bonne camaraderie et de b&eacute;n&eacute;ficier de conseils.</span></p>\r\n\r\n<p style=\"margin-left:40px\"><span style=\"font-family:Georgia,serif\">Toutes les formes de courses sont pratiqu&eacute;es&nbsp;(cross country, route, piste, trail)&nbsp;&agrave; toutes les allures, chaque adh&eacute;rent organise sa saison sportive comme il le d&eacute;sire sans obligation sportive envers le club.</span></p>\r\n\r\n<p style=\"margin-left:40px\"><span style=\"font-family:Georgia,serif\">L&#39;Amicale du Val de Somme c&#39;est &eacute;galement une&nbsp;&eacute;quipe technique, &agrave; votre disposition, pr&ecirc;te &agrave; vous donner tous les conseils d&#39;entra&icirc;nement, de pr&eacute;paration, de r&eacute;cup&eacute;ration lors des entra&icirc;nements et regroupements hebdomadaires, sur les courses ou autres lieux de rencontre.</span></p>\r\n\r\n<p style=\"margin-left:40px\"><span style=\"font-family:Georgia,serif\">Le Val de Somme, c&#39;est aussi une&nbsp;&eacute;quipe organisatrice de comp&eacute;titions dans le d&eacute;partement depuis plus de 20 ans, en particulier &agrave; Amiens avec les 10 Kilom&egrave;tres des 4 Saisons.</span></p>\r\n\r\n<p style=\"margin-left:40px\"><span style=\"font-family:Georgia,serif\">Le club prend &eacute;galement un part active&nbsp;dans l&#39;organisation du Marathon et des 100 Kilom&egrave;tres de la Somme&nbsp;(Mesurage, Fl&eacute;chage, Inscriptions, Chronom&eacute;trage &agrave; puces, Suivi en live, etc...)</span></p>\r\n\r\n<h1><span style=\"font-family:Georgia,serif\">Les lieux et horaires des entrainements</span></h1>\r\n\r\n<p style=\"margin-left:40px\"><strong><span style=\"font-family:Georgia,serif\">La Hotoie</span></strong></p>\r\n\r\n<p style=\"margin-left:80px\"><span style=\"font-family:Georgia,serif\">Regroupements pr&egrave;s de l&#39;entr&eacute;e de l&#39;all&eacute;e du zoo<br />\r\nLe mardi de 18H00 &agrave; 19H30<br />\r\nLe jeudi de 18H00 &agrave; 19H30</span></p>\r\n\r\n<p style=\"margin-left:40px\"><span style=\"font-family:Georgia,serif\"><strong>Stade Lucien Jovelin de Camon</strong></span></p>\r\n\r\n<p style=\"margin-left:80px\"><span style=\"font-family:Georgia,serif\">Entrainements sur la piste et chemin de halage<br />\r\nLe mercredi de 17H45 &agrave; 20H00 : rendez-vous &agrave; partir de 17h45 pour &eacute;chauffement individuel ou collectif, d&eacute;but des gammes &agrave; 18h20 pr&eacute;cises, d&eacute;but de la s&eacute;ance piste &agrave; 18h30 pr&eacute;cises.<br />\r\nLe samedi matin &agrave; 10h : programme d&eacute;fini par les coachs en fonction des objectifs du moment</span><br />\r\n&nbsp;</p>\r\n\r\n<h1><span style=\"font-family:Georgia,serif\">Les entraineurs</span></h1>\r\n\r\n<p style=\"margin-left:40px\"><span style=\"font-family:Georgia,serif\">Le club a la chance de compter dans ses rangs plusieurs entraineurs dipl&ocirc;m&eacute;s :&nbsp;</span></p>\r\n\r\n<p style=\"margin-left:40px\"><span style=\"font-family:Georgia,serif\"><strong>Jean-Fran&ccedil;ois DELASALLE :&nbsp;</strong>coach dipl&ocirc;m&eacute; niveau 3&nbsp;&quot;coach running performance&quot;.</span></p>\r\n\r\n<p style=\"margin-left:40px\"><span style=\"font-family:Georgia,serif\"><strong>Patrice LEBEAU :&nbsp;</strong>coach dipl&ocirc;m&eacute; niveau 2</span></p>\r\n\r\n<p style=\"margin-left:40px\"><span style=\"font-family:Georgia,serif\"><strong>Daniel JOUBERT :&nbsp;</strong>coach dipl&ocirc;m&eacute; niveau 1, en formation pour le niveau 2 &quot;initiateur running performance&quot;</span></p>\r\n\r\n<p style=\"margin-left:40px\"><span style=\"font-family:Georgia,serif\"><strong>Dominique LAZURE :&nbsp;</strong>coach dipl&ocirc;m&eacute; niveau 1, en formation pour le niveau 2 &quot;animateur forme-sant&eacute; option marche nordique&quot;</span></p>\r\n\r\n<p style=\"margin-left:40px\"><span style=\"font-family:Georgia,serif\"><strong>Mihidinn RAHBI :&nbsp;</strong>coach dipl&ocirc;m&eacute; niveau 1, en formation pour le niveau 2 &quot;initiateur running performance&quot;</span></p>\r\n\r\n<p style=\"margin-left:40px\"><span style=\"font-family:Georgia,serif\"><strong>Christophe FLEURET :&nbsp;</strong>niveau 1 &quot;Assistant running performance&quot;</span></p>\r\n\r\n<p style=\"margin-left:40px\"><span style=\"font-family:Georgia,serif\">Vous avez besoin de conseils, d&#39;un avis pertinent, d&#39;un plan d&#39;entra&icirc;nement ? N&#39;h&eacute;sitez pas &agrave; les contacter.</span></p>\r\n\r\n<p style=\"margin-left:40px\"><span style=\"font-family:Georgia,serif\">Vous &ecirc;tes int&eacute;ress&eacute;(e) par une formation au coaching ? Contactez Bruno Rouchereau, r&eacute;f&eacute;rent formation du club.</span></p>\r\n\r\n<h1><span style=\"font-family:Georgia,serif\">Le comit&eacute; directeur du club</span></h1>\r\n\r\n<table cellspacing=\"0\" class=\"MsoTableGrid\" style=\"border-collapse:collapse; border:none; margin-left:38px; width:620px\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"border-bottom:1px solid black; border-left:1px solid black; border-right:1px solid black; border-top:1px solid black; vertical-align:top; width:208px\">\r\n			<p style=\"text-align:justify\"><span style=\"font-family:Georgia,serif\"><span style=\"font-size:12pt\"><strong>Dominique LAZURE</strong></span></span></p>\r\n			</td>\r\n			<td style=\"border-bottom:1px solid black; border-left:none; border-right:1px solid black; border-top:1px solid black; vertical-align:top; width:412px\">\r\n			<p style=\"text-align:justify\"><span style=\"font-family:Georgia,serif\"><span style=\"font-size:12pt\">Pr&eacute;sident</span></span></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"border-bottom:1px solid black; border-left:1px solid black; border-right:1px solid black; border-top:none; vertical-align:top; width:208px\">\r\n			<p style=\"text-align:justify\"><span style=\"font-family:Georgia,serif\"><span style=\"font-size:12pt\"><strong>Bruno ROUCHEREAU</strong></span></span></p>\r\n			</td>\r\n			<td style=\"border-bottom:1px solid black; border-left:none; border-right:1px solid black; border-top:none; vertical-align:top; width:412px\">\r\n			<p style=\"text-align:justify\"><span style=\"font-family:Georgia,serif\"><span style=\"font-size:12pt\">Vice-Pr&eacute;sident en charge des formations et des dossiers d&#39;organisation des 4 saisons</span></span></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"border-bottom:1px solid black; border-left:1px solid black; border-right:1px solid black; border-top:none; vertical-align:top; width:208px\">\r\n			<p style=\"text-align:justify\"><span style=\"font-family:Georgia,serif\"><span style=\"font-size:12pt\"><strong>Christian WYCKAERT</strong></span></span></p>\r\n			</td>\r\n			<td style=\"border-bottom:1px solid black; border-left:none; border-right:1px solid black; border-top:none; vertical-align:top; width:412px\">\r\n			<p style=\"text-align:justify\"><span style=\"font-family:Georgia,serif\"><span style=\"font-size:12pt\">Secr&eacute;taire en charge des inscriptions, des adh&eacute;sions et des licences FFA Coordinateur des b&eacute;n&eacute;voles</span></span></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"border-bottom:1px solid black; border-left:1px solid black; border-right:1px solid black; border-top:none; vertical-align:top; width:208px\">\r\n			<p style=\"text-align:justify\"><span style=\"font-family:Georgia,serif\"><span style=\"font-size:12pt\"><strong>Isabelle MOREIRA</strong></span></span></p>\r\n			</td>\r\n			<td style=\"border-bottom:1px solid black; border-left:none; border-right:1px solid black; border-top:none; vertical-align:top; width:412px\">\r\n			<p style=\"text-align:justify\"><span style=\"font-family:Georgia,serif\"><span style=\"font-size:12pt\">Secr&eacute;taire adjointe en charge de la gestion du cr&eacute;dit dossards</span></span></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"border-bottom:1px solid black; border-left:1px solid black; border-right:1px solid black; border-top:none; vertical-align:top; width:208px\">\r\n			<p style=\"text-align:justify\"><span style=\"font-family:Georgia,serif\"><span style=\"font-size:12pt\"><strong>Guy VERGHOTE</strong></span></span></p>\r\n			</td>\r\n			<td style=\"border-bottom:1px solid black; border-left:none; border-right:1px solid black; border-top:none; vertical-align:top; width:412px\">\r\n			<p style=\"text-align:justify\"><span style=\"font-family:Georgia,serif\"><span style=\"font-size:12pt\">Tr&eacute;sorier et&nbsp;Webmaster</span></span></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"border-bottom:1px solid black; border-left:1px solid black; border-right:1px solid black; border-top:none; vertical-align:top; width:208px\">\r\n			<p style=\"text-align:justify\"><span style=\"font-family:Georgia,serif\"><span style=\"font-size:12pt\"><strong>Jean-Fran&ccedil;ois DELASALLE</strong></span></span></p>\r\n			</td>\r\n			<td style=\"border-bottom:1px solid black; border-left:none; border-right:1px solid black; border-top:none; vertical-align:top; width:412px\">\r\n			<p style=\"text-align:justify\"><span style=\"font-family:Georgia,serif\"><span style=\"font-size:12pt\">Tr&eacute;sorier adjoint et&nbsp;R&eacute;f&eacute;rent FFA</span></span></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"border-bottom:1px solid black; border-left:1px solid black; border-right:1px solid black; border-top:none; vertical-align:top; width:208px\">\r\n			<p style=\"text-align:justify\"><span style=\"font-family:Georgia,serif\"><span style=\"font-size:12pt\"><strong>Nicolas DENIN</strong></span></span></p>\r\n			</td>\r\n			<td style=\"border-bottom:1px solid black; border-left:none; border-right:1px solid black; border-top:none; vertical-align:top; width:412px\">\r\n			<p style=\"text-align:justify\"><span style=\"font-family:Georgia,serif\"><span style=\"font-size:12pt\">Community manager, r&eacute;seaux sociaux</span></span></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"border-bottom:1px solid black; border-left:1px solid black; border-right:1px solid black; border-top:none; vertical-align:top; width:208px\">\r\n			<p style=\"text-align:justify\"><span style=\"font-family:Georgia,serif\"><span style=\"font-size:12pt\"><strong>Jean-Pierre JOLY</strong></span></span></p>\r\n			</td>\r\n			<td style=\"border-bottom:1px solid black; border-left:none; border-right:1px solid black; border-top:none; vertical-align:top; width:412px\">\r\n			<p style=\"text-align:justify\"><span style=\"font-family:Georgia,serif\"><span style=\"font-size:12pt\">Accueil des nouveaux adh&eacute;rents</span></span></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"border-bottom:1px solid black; border-left:1px solid black; border-right:1px solid black; border-top:none; vertical-align:top; width:208px\">\r\n			<p style=\"text-align:justify\"><span style=\"font-family:Georgia,serif\"><span style=\"font-size:12pt\"><strong>La&euml;titia MELCHIOR</strong></span></span></p>\r\n			</td>\r\n			<td style=\"border-bottom:1px solid black; border-left:none; border-right:1px solid black; border-top:none; vertical-align:top; width:412px\">\r\n			<p style=\"text-align:justify\"><span style=\"font-family:Georgia,serif\"><span style=\"font-size:12pt\">Relations publiques, institutionnelles et partenaires</span></span></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"border-bottom:1px solid black; border-left:1px solid black; border-right:1px solid black; border-top:none; vertical-align:top; width:208px\">\r\n			<p style=\"text-align:justify\"><span style=\"font-family:Georgia,serif\"><span style=\"font-size:12pt\"><strong>Claude SIMIONI</strong></span></span></p>\r\n			</td>\r\n			<td style=\"border-bottom:1px solid black; border-left:none; border-right:1px solid black; border-top:none; vertical-align:top; width:412px\">\r\n			<p style=\"text-align:justify\"><span style=\"font-family:Georgia,serif\"><span style=\"font-size:12pt\">Correspondante adh&eacute;rents</span></span></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"border-bottom:1px solid black; border-left:1px solid black; border-right:1px solid black; border-top:none; vertical-align:top; width:208px\">\r\n			<p style=\"text-align:justify\"><span style=\"font-family:Georgia,serif\"><span style=\"font-size:12pt\"><strong>Ludovic TISON</strong></span></span></p>\r\n			</td>\r\n			<td style=\"border-bottom:1px solid black; border-left:none; border-right:1px solid black; border-top:none; vertical-align:top; width:412px\">\r\n			<p style=\"text-align:justify\"><span style=\"font-family:Georgia,serif\"><span style=\"font-size:12pt\">en charge de l&#39;Animation, des festivit&eacute;s et des sorties collectives</span></span></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"border-bottom:1px solid black; border-left:1px solid black; border-right:1px solid black; border-top:none; vertical-align:top; width:208px\">\r\n			<p style=\"text-align:justify\"><span style=\"font-family:Georgia,serif\"><span style=\"font-size:12pt\"><strong>Philippe VANDURME</strong></span></span></p>\r\n			</td>\r\n			<td style=\"border-bottom:1px solid black; border-left:none; border-right:1px solid black; border-top:none; vertical-align:top; width:412px\">\r\n			<p style=\"text-align:justify\"><span style=\"font-family:Georgia,serif\"><span style=\"font-size:12pt\">en charge du projet de Club et des projets sportifs. R&eacute;f&eacute;rent diversification et innovation</span></span></p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n'),(2,'Adhsion au club','<p><strong>Quelles sont les&nbsp;avantages d&#39;une licence &agrave; l&#39;Amicale du Val de Somme pour la Saison 2022-2023</strong></p>\n\n<p style=\"margin-left:40px\">Prise au Val de Somme, elle permet de s&#39;incrire gratuitement aux 4 &eacute;ditions des&nbsp;4 saisons d&#39;Amiens M&eacute;tropole organis&eacute;es par le club.</p>\n\n<p style=\"margin-left:40px\">Vous disposez d&#39;entraineurs diplom&eacute;s du&nbsp;niveau 1 au niveau 3</p>\n\n<p style=\"margin-left:40px\">Le club incite ses membres &agrave; suivre des formations en finan&ccedil;ant leur participation aux stages FFA (coachs, jury, dirigeant&hellip;)</p>\n\n<p style=\"margin-left:40px\">La mise en place d&#39;un cr&eacute;dit dossard de 30&euro;&nbsp;:</p>\n\n<p style=\"margin-left:80px\">&ndash; &agrave; valoir sur des courses labellis&eacute;es FFA</p>\n\n<p style=\"margin-left:80px\">&ndash; &agrave; d&eacute;duire de l&#39;adh&eacute;sion de l&#39;ann&eacute;e suivante (2023-2024)</p>\n\n<p style=\"margin-left:80px\">&ndash; &agrave; exercer en renouvelant l&#39;adh&eacute;sion avant le 31/08/2023 (fournir les justificatifs &agrave; Isabelle Moreira avant le 30/06)</p>\n\n<p style=\"margin-left:40px\">Transport en car gratuit lors du ou des d&eacute;placements officiels du club sur des courses (ex 10Km et semi- marathon de Saint Denis en 2019)</p>\n\n<p style=\"margin-left:40px\">Il y a encore de nombreux avantages :</p>\n\n<p style=\"margin-left:80px\">Le calendrier des courses p&eacute;destres, sera distribu&eacute; lors des entra&icirc;nements du club et les courses courant Janvier.</p>\n\n<p style=\"margin-left:80px\">Des infos sur les divers &eacute;v&egrave;nements ou r&eacute;ductions offertes par le Val de Somme seront disponibles sur le site du club.</p>\n\n<p style=\"margin-left:80px\">La participation aux diff&eacute;rents challenges de courses p&eacute;destres (d&eacute;partementaux, r&eacute;gionaux, nationaux) est automatique pour tous les licenci&eacute;s du club.</p>\n\n<p><strong>Comment adh&eacute;rer &agrave; l&#39;Amicale du Val de Somme pour la Saison 2022-2023 ?</strong></p>\n\n<p style=\"margin-left:40px\">Les adh&eacute;sions se font maintenant en ligne par interm&eacute;diaire d&#39;un nouveau site qui prend en charge votre paiement en ligne (par CB). &nbsp;</p>\n\n<p style=\"margin-left:40px\">Le&nbsp;lien sera fonctionnel&nbsp;&agrave; partir du mois de Juillet</p>\n\n<p style=\"margin-left:40px\"><a class=\"btn btn-danger\" href=\"https://www.njuko.net/valdesomme23/select_competition\" target=\"_blank\">S&#39;inscrire pour la saison 2022-2023</a></p>\n\n<p style=\"margin-left:40px\">A la fin de la proc&eacute;dure d&#39;adh&eacute;sion vous devez avoir pris connaissance et accept&eacute; les statuts et le r&egrave;glement int&eacute;rieur du club.</p>\n\n<p style=\"margin-left:40px\">Ces documents sont disponibles dans la rubrique&nbsp;&#39;R&egrave;glement et autres document&#39;&nbsp;du menu &#39;Le club&#39; :&nbsp;<a href=\"https://www.valdesomme.net/documentation/consultation.php?idType=1\" target=\"_blank\">Voir les documents</a></p>\n\n<p style=\"margin-left:40px\">Une fois le formulaire d&#39;adh&eacute;sion en ligne saisi, et le certificat m&eacute;dical envoy&eacute; par mail, les licences 2022-2023&nbsp;seront saisies par notre secr&eacute;taire sur le serveur de la FFA et les membres recevront&nbsp;<strong>directement de la FFA par Mail</strong>&nbsp;un fichier joint comportant la nouvelle licence elle-m&ecirc;me, &agrave; garder et imprimer pour les justificatifs r&eacute;clam&eacute;s lors des inscriptions aux courses.</p>\n\n<p style=\"margin-left:40px\"><strong>Aucun courrier postal ne sera adress&eacute;</strong>&nbsp;concernant la licence FFA. Il est donc important&nbsp;<strong>de communiquer correctement et lisiblement</strong>&nbsp;votre derni&egrave;re adresse Email.&nbsp;</p>\n\n<p style=\"margin-left:40px\">La dur&eacute;e de validit&eacute; de la licence s&#39;etend du premier septembre au 31 ao&ucirc;t. La pr&eacute; saisie peut commencer &agrave; partir de la fin du mois de juin.&nbsp;</p>\n\n<p><strong>Quels sont les montants de la cotisation pour la saison 2022-2023 ?</strong></p>\n\n<p style=\"margin-left:40px\">Montant de l&#39;adh&eacute;sion&nbsp;avec une licence Running : <strong>50,00 Euros</strong></p>\n\n<p style=\"margin-left:40px\">Montant de l&#39;adh&eacute;sion&nbsp;avec une licence Comp&eacute;tition : <strong>70,00 Euros</strong></p>\n\n<p style=\"margin-left:40px\">Montant de l&#39;adh&eacute;sion sans prise de licence (donc sans les avantages accord&eacute;es par celle-ci) : <strong>15,00 Euros</strong></p>\n\n<p style=\"margin-left:40px\">Indication : Pour les licenci&eacute;s disposant d&#39;un cr&eacute;dit dossard, le montant de la cotisation sera automatiquement diminu&eacute; de la valeur du cr&eacute;dit dossard <strong>si la licence est enregistr&eacute;e avant le 31 ao&ucirc;t</strong></p>\n\n<p><strong>Modalit&eacute;s de r&egrave;glement :</strong></p>\n\n<p style=\"margin-left:40px\">Privil&eacute;giez le r&egrave;glement en ligne sur le site de notre partenaire klikego (CB s&eacute;curis&eacute;).&nbsp;</p>\n\n<p style=\"margin-left:40px\">Possibilit&eacute; de r&egrave;gler avec des <strong>coupons sport </strong>(ANCV) ou des <strong>tickets sport</strong>.</p>\n\n<p style=\"margin-left:40px\">Pour les jeunes athl&egrave;tes qui en b&eacute;n&eacute;ficient, le club accepte aussi les <strong>pass&#39;sport </strong>du minist&egrave;re de l&#39;&eacute;ducation nationale et des sports. Avant de vous inscrire, contactez le club &agrave; contact@valdesomme.net</p>\n\n<p>&nbsp;</p>\n\n<p><strong>Quelle diff&eacute;rence entre la Licence FFA Running et la licence FFA Comp&eacute;tition (&agrave; part le prix) ?&nbsp;</strong></p>\n\n<p style=\"margin-left:40px\">Ses&nbsp;deux licences vous permettent&nbsp;de courir partout en France sans avoir &agrave; pr&eacute;senter &agrave; chaque fois un certificat m&eacute;dical <strong>mais seule la licence FFA Comp&eacute;tition</strong> autorise la participation et le classement aux championnats r&eacute;gionaux ou nationaux FFA, route, cross et piste.</p>\n\n<p style=\"margin-left:40px\"><strong>Attention</strong>: Aucun changement de type de licence ne sera possible apr&egrave;s l&#39;enregistrement informatique effectu&eacute;.</p>\n\n<p>&nbsp;</p>\n\n<p><strong>Mutation</strong></p>\n\n<p style=\"margin-left:40px\">Une mutation sportive FFA est obligatoire si lors de la saison sportive pr&eacute;c&eacute;dente vous &eacute;tiez dans un autre club FFA. Danc ce cas, prenez contact avec le club pour obtenir tous les renseignements en &eacute;crivant &agrave; l&#39;adresse mail <strong>contact@valdesomme.net</strong></p>\n\n<p><strong>Assurance</strong></p>\n\n<p style=\"margin-left:40px\">Le club a opt&eacute; pour l&#39;assurance responsabilit&eacute; civile propos&eacute;e par la&nbsp;<strong>FFA.</strong></p>\n\n<p style=\"margin-left:40px\">Vous &ecirc;tes assur&eacute;s par votre licence FFA dans le cadre des&nbsp;<strong>comp&eacute;titions</strong>&nbsp;et des&nbsp;<strong>entra&icirc;nements du club</strong></p>\n\n<p style=\"margin-left:40px\">Le licenci&eacute; peut souscrire un contrat d&#39;assurance individuelle accident couvrant les dommages corporels auxquels sa pratique sportive peut l&#39;exposer, mais elle n&#39;est pas obligatoire. Le licenci&eacute; recevra directement &agrave; son domicile en m&ecirc;me temps que sa licence, un bulletin d&#39;adh&eacute;sion aux options compl&eacute;mentaires, &agrave; adresser&nbsp;<strong>directement &agrave; l&#39;assurance de la FFA</strong>&nbsp;pour toute souscription suppl&eacute;mentaire souhait&eacute;e.</p>\n\n<p>&nbsp;</p>\n'),(3,'Prsentation des 4 saisons','<p><strong>Les courses des 4 saisons &agrave; Amiens pr&egrave;s du Val de Somme (4 fois par an) :</strong></p>\n\n<p><strong><em>Calendrier saison 2021-2022</em></strong></p>\n\n<p><strong>06/11/2022</strong> Courses des 4 Saisons Finale d&#39;Automne</p>\n\n<p><strong>05/03/2023</strong>&nbsp;Courses des 4 Saisons d&#39;Hiver</p>\n\n<p><strong>07/05/2023</strong>&nbsp;Courses des 4 Saisons de printemps</p>\n\n<p><strong>02/07/2023</strong>&nbsp;Courses des 4 Saisons d&#39;&eacute;t&eacute;</p>\n\n<p><strong><em>Horaires et distances des courses</em></strong></p>\n\n<p><strong>09h20</strong>&nbsp;5 Km d&eacute;couverte</p>\n\n<p>&Eacute;preuve ouverte &agrave; partir de la cat&eacute;gorie Minimes, coureurs licenci&eacute;s ou non licenci&eacute;s.</p>\n\n<p><strong>10h05</strong>&nbsp;10 Km des joggers</p>\n\n<p>&Eacute;preuve ouverte &agrave; partir de la cat&eacute;gorie Cadets, coureurs licenci&eacute;s ou non licenci&eacute;s. Joggers du dimanche, d&eacute;butants ou confirm&eacute;s en&nbsp;45 minutes et plus&nbsp;(chronom&eacute;trage &agrave; partir de 44 minutes pour les hommes : toute performance inf&eacute;rieure &agrave; 44&#39; sera ramen&eacute;e &agrave; 44&#39; dans le classement officiel, le temps r&eacute;el sera pris en compte pour les f&eacute;minines).&nbsp;</p>\n\n<p><strong>11h20</strong>&nbsp;10 Km des as</p>\n\n<p>&nbsp;</p>\n\n<p>Coureurs en moins de 45 minutes. Tous les temps (m&ecirc;me sup&eacute;rieurs &agrave; 45&#39;00) sont pris en compte. &Eacute;preuve ouverte &agrave; partir de la cat&eacute;gorie Cadets, coureurs licenci&eacute;s ou non licenci&eacute;s.</p>\n\n<p><strong><em>Les 3 courses de 5 et 10 km sont inscrites au challenge d&eacute;partemental de la Somme.</em></strong></p>\n\n<p><strong><em>Classements</em></strong></p>\n\n<p>Le classement g&eacute;n&eacute;ral de l&#39;&eacute;preuve des 10 Kilom&egrave;tres des 4 saisons est &eacute;tabli &agrave; partir de l&#39;ensemble des temps r&eacute;alis&eacute;s sur les 2 &eacute;preuves distinctes (10 Km des Joggers et 10 Km des As).<br />\nSi un coureur participe aux 2 &eacute;preuves de 10 Km, ses deux temps seront retenus.</p>\n\n<p><strong>Pour les hommes, les temps r&eacute;alis&eacute;s sur l&#39;&eacute;preuve des 10 Kilom&egrave;tres des Joggers inf&eacute;rieurs &agrave; 44 minutes sont ramen&eacute;s &agrave; 44 minutes</strong>. Cette clause ne s&#39;applique pas pour les f&eacute;minines.</p>\n\n<p><strong><em>Inscriptions aux courses</em></strong></p>\n\n<p>L&#39;inscription vous donne la possibilit&eacute; de participer &agrave; l&#39;ensemble des courses propos&eacute;es &nbsp;(5 Km, 10 Km populaire et 10 Km des as)</p>\n\n<p>Elle s&#39;effectue <strong>en ligne</strong> &agrave; partir de la plateforme d&#39;inscription en ligne de klikego. Le lien permettant de vous inscrire sera affich&eacute; sur notre site et sur le site de Courses 80 d&egrave;s que les inscriptions seront ouvertes.</p>\n\n<p>Toutes les informations de tarifs, dates limites d&#39;inscription, etc... figurent sur le plateforme d&#39;inscriptions ou&nbsp; sur notre site.</p>\n\n<p><strong>Important : Aucune inscription sur place et aucune inscription apr&egrave;s la cl&ocirc;ture des inscriptions en ligne</strong></p>\n\n<p><br />\nToutes les &eacute;preuves courues se font avec le m&ecirc;me dossard et la m&ecirc;me puce de chronom&eacute;trie.<br />\n<strong>Dans tous les cas, ne rendez votre puce qu&#39;apr&egrave;s avoir particip&eacute; &agrave; votre derni&egrave;re course.</strong></p>\n\n<p><strong><em>Licences ou Certificats M&eacute;dicaux</em></strong></p>\n\n<p><strong>Attention:</strong>&nbsp;Seules les licences de la F&eacute;d&eacute;ration Fran&ccedil;aise d&#39;Athl&eacute;tisme, et de la F&eacute;d&eacute;ration UFOLEP Athl&eacute;tisme ou courses sur route sont admises pour les inscriptions sur les courses hors stade.</p>\n\n<p>Pour tous les autres,&nbsp;sans exception, il sera n&eacute;cessaire de fournir un certificat m&eacute;dical dat&eacute; de moins d&#39;un an au jour de l&#39;&eacute;preuve (ou copie)&nbsp;de non contre-indication la pratique de la course &agrave; pied en comp&eacute;tition&nbsp;ou&nbsp;de non contre-indication la pratique de l&#39;athl&eacute;tisme en comp&eacute;tition. Ce document sera gard&eacute; obligatoirement pendant un an par l&#39;organisateur.</p>\n\n<p>Un mod&egrave;le de certificat m&eacute;dical est disponible sur le site dans la rubrique &ldquo;Documentation &agrave; t&eacute;l&eacute;charger&rdquo; du menu 4 saisons.</p>\n\n<p>Nouveaut&eacute; : pour les mineurs non licenci&eacute;s, le certificat m&eacute;dical n&#39;est plus obligatoire, un simple attestation sur l&#39;honneur indiquant avoir pris connaissance du questionnaire de sant&eacute; concernant les mineurs et avoir r&eacute;pondu non &agrave; chacune des 24 questions suffit.</p>\n\n<p>Le questionnaire est consultable &agrave; l&#39;adresse suivante :</p>\n\n<p>https://www.legifrance.gouv.fr/jorf/id/JORFTEXT000043486824</p>\n\n<p>&nbsp;</p>\n\n<p><strong><em>Retrait des dossards</em></strong></p>\n\n<p>Le matin, avant le d&eacute;part des courses, ouverture du secr&eacute;tariat &agrave; 8H30.</p>\n\n<p>Le secr&eacute;tariat ainsi que les arriv&eacute;es des courses se situent sous la halle, parc du Grand Marais &agrave; Amiens.</p>\n\n<p><strong><em>Autorisation parentale</em></strong></p>\n\n<p>Tous les comp&eacute;titeurs mineurs non licenci&eacute;s doivent pr&eacute;senter un autorisation parentale sign&eacute;e.</p>\n\n<p>Un mod&egrave;le de certificat m&eacute;dical est disponible sur le site dans la rubrique &ldquo;Documentation &agrave; t&eacute;l&eacute;charger&rdquo; du menu 4 saisons.</p>\n\n<p><strong><em>Parcours</em></strong></p>\n\n<p>Le d&eacute;part des &eacute;preuves se situe en contrebas du parc sur le chemin de halage pr&egrave;s de l&#39;&eacute;cluse<br />\n<a name=\"_Hlk76381562\">Le secr&eacute;tariat dossard, ainsi que les arriv&eacute;es des courses se situent sous la halle</a>.</p>\n\n<p><strong><em>Venir</em></strong></p>\n\n<p>La course est organis&eacute;e au Parc du Grand Marais, rue du Grand Marais &agrave; Amiens (quartier &Eacute;touvie).</p>\n\n<p>Pour se rendre sur le lieu de la course, &agrave; partir de l&#39;h&ocirc;pital Nord, prendre la rue de Vignacourt (sens descente), tourner &agrave; droite au premier feu (rue St Maurice), et continuer tout droit jusqu&#39;au Parc.</p>\n\n<p>Depuis Amiens par la rocade Nord direction Abbeville, ou depuis Abbeville par la RN1, prendre la sortie 40 direction Longpr&eacute; les Amiens, suivre la direction Parc de Loisirs - Camping Parc des Cygnes</p>\n'),(4,'Formation','<p>Si Vous souhaitez obtenir des informations concernant les diffrentes formations proposes par l\'OFA l\'organisme de formation de la FFA. vous pouvez contacter Bruno Rouchereau membre du Conseil d\'administration de notre club qui vous renseignera.</p><figure class=\"image\"><img src=\"https://www.athle.fr/images/formation/ofa-comment.png\" alt=\"\"></figure><p>Lorganisme de formation de lathltisme (OFA) regroupe toute loffre de formation de lathltisme, de lentrainement aux dirigeants, des juges aux organisateurs dvnements.</p><p>Lunit pdagogique regroupe quatre principaux <strong>domaines de formation</strong> :<br>&nbsp;</p><figure class=\"image\"><img src=\"https://www.athle.fr/images/formation/direction.gif\"></figure><p><br> <strong>Le domaine  direction </strong> regroupe loffre de formation propose aux dirigeants bnvoles, mais aussi aux salaris des ligues, des comits ou des clubs en charge de direction (direction sportive, gnrale) ou encore chargs de missions (dveloppement, projet, etc.).<br>&nbsp;</p><figure class=\"image\"><img src=\"https://www.athle.fr/images/formation/encadrement.gif\"></figure><p><br> <strong>Le domaine  encadrement sportif </strong> regroupe lensemble de loffre de formation ncessaire pour encadrer les athltes en recherche de performance, la prise en charge des jeunes ds le plus jeune ge, ou encore lencadrement&nbsp; des activits de forme et de sant<br><br>&nbsp;</p><figure class=\"image\"><img src=\"https://www.athle.fr/images/formation/jury.gif\"></figure><p><br> <strong>Le domaine  jury </strong> concerne la formation des juges en charge de la gestion des comptitions et du respect des rgles dusage, mais aussi tout le secteur informatique qui oeuvre au ct des juges pour le bon droulement des comptitions.<br><br>&nbsp;</p><figure class=\"image\"><img src=\"https://www.athle.fr/images/formation/organisation.gif\"></figure><p><br> <strong>Le domaine  organisation dvnements </strong> propose daider et de former tous ceux qui souhaitent prendre en charge lorganisation d\'vnements et d\'animations et prendre part au bon droulement des manifestations sportives.</p><p><br><strong>De nouvelles filires.</strong><br>Chaque domaine de formation a repens lorganisation de ses filires de formation. Chacune delle rpond  un ensemble de fonctions permettant de participer aux activits de son club ou de la structure fdrale dans laquelle vous tes investi, fonctions qui contribuent  latteinte des objectifs du plan de dveloppement de la FFA.</p><figure class=\"image\"><img src=\"https://www.athle.fr/images/formation/filieres.jpg\"></figure><p><strong>Dveloppement de la formation continue</strong><br>Pour chaque domaine et chaque filire, une offre de formation sous forme de modules complmentaires est propose. Le calendrier de formation vous permettra de trouver une formation spcifique, adapte  vos besoins, entirement  la carte. Ces formations sont enregistres sur votre profil et seront prises en compte dans le cadre de votre parcours de formation, valorises pour le niveau de formation suivant. Vous pouvez galement choisir de passer un diplme  l\'occasion d\'une preuve spcifique,  l\'issue d\'un parcours de formation normalis, un diplme fdral qui correspondra  la fonction vise.</p><p><strong>Le module, unit pdagogique de rfrence</strong><br>Chaque formation est organise en modules. Ils sont choisis par le candidat, entirement  la carte, si votre projet est seulement de vous former pour devenir plus comptent. Si vous voulez un diplme, votre choix sera orient avec des modules obligatoires, transversaux ou avec des choix d\'option ou de spcialit, ensemble de modules constituant la qualification vise.<br>&nbsp;</p><figure class=\"image\"><img src=\"https://www.athle.fr/images/formation/presentation.jpg\"></figure><p><br>Un module est en ralit laddition de diffrents temps de formation :<br>&nbsp;</p><p><strong>FOAD </strong>(Formation Ouverte et  Distance) : la plateforme de formation (formation-athle.fr) vous permettra daccder,  votre rythme et  votre domicile,  des contenus de formation slectionns par vos formateurs, sous forme de texte, de quizz, de vido<br><br>&nbsp;<strong>FFP</strong> (Face  Face Pdagogique) : formation sous forme de regroupement, encadre par un formateur, cette situation de formation vous amnera  vous dplacer et  choisir les lieux de formation, et constituera un lment central de la formation.<br>&nbsp;</p><p><strong>Stage</strong> (Mise en Situation) : chaque module donnera galement lieu  une partie de formation sous forme de stage pdagogique en situation relle, sur votre terrain, dans votre club ou en encadrement de comptition, en stage, ou encore en situation de gestion du projet du club ou de la structure fdrale, avec un tuteur dsign.<br><br>&nbsp;<strong>Evaluation </strong>: chaque module est valu. Le rsultat est enregistr dans votre profil et cette valuation sera ncessaire pour prtendre la validation dun diplme.</p><p><strong>Les Diplmes :</strong><br>Un diplme est le cumul de lvaluation positive de chaque module qui constitue la qualification, dune part, et le rsultat dune valuation finale dautre part. En fonction des filires, cette valuation est ralise le plus souvent possible en situation relle, sur le terrain, et permet la validation de toute la formation et de tous les modules, y compris ceux ayant donn lieu  un allgement de formation.</p><figure class=\"image\"><img src=\"https://www.athle.fr/images/formation/offreformation.png\"></figure><p>&nbsp;</p>'),(5,'Mentions lgales','<p><i><strong>Mention de droits rservs</strong></i></p><p style=\"margin-left:auto;\">&nbsp;</p><p style=\"margin-left:auto;\">Conformment  la mise place du RGPD en vigueur le 24 mai 2018, les informations vous concernant sont destines  l\'Amicale du Val de Somme, responsable du traitement. Vous disposez dun droit daccs, de rectification et de suppression des donnes qui vous concernent. Vous pouvez exercer ce droit en adressant un e-mail  ladresse lectronique suivante :&nbsp;<span style=\"color:rgb(80,87,91);\">contact@valdesomme.net</span></p><p style=\"margin-left:auto;\">Les informations fournies seront exploites de manire anonyme et non nominatives  des fins danalyse et de statistique.</p><p style=\"margin-left:auto;\">En vous connectant  ce site dit et mis en ligne par Le Val de Somme, vous accdez  un contenu protg par la loi, notamment par les dispositions du Code de la proprit intellectuelle.</p><p style=\"margin-left:auto;\">Les marques de lditeur du site Amicale du Val De Somme et de ses partenaires, ainsi que les logos figurant sur le site sont des marques dposes. Le tlchargement de tout ou partie des textes, images, sons, photographies, donnes, marques et tout autre lment contenu est autoris  des fins strictement prives, dans le cadre scolaire ou pour un usage non commercial.</p><p style=\"margin-left:auto;\">L\'<span style=\"color:rgb(0,0,0);\">Amicale du Val de Somme</span> nautorise quun 