span style=\"color:rgb(51,51,51);\"><i><strong>charte relative relative  la protection des donnes  caractre personnel des utilisateurs</strong></i></span></p><p>&nbsp;</p><p><i><strong>1  Dfinition et nature des donnes  caractre personnel</strong></i></p><p>&nbsp;</p><p style=\"margin-left:0px;\">Lors de votre utilisation du site internet accessible  ladresse&nbsp; http://www.valdesomme.net/ ou sur une <i>Plateforme</i>, qui nous permet de grer les adhsions, nous pouvons tre amens  vous demander de nous communiquer des donnes  caractre personnel vous concernant, dsignant toutes les donnes qui permettent didentifier un individu directement ou indirectement.</p><p style=\"margin-left:0px;\">Dans ce cadre, nous collectons les donnes suivantes :</p><hr><p><i><strong>1.1  Information que vous nous communiquez</strong></i></p><p>&nbsp;</p><p style=\"margin-left:0px;\">Pour la bonne excution des services que nous proposons dans le cadre de nos activits sportives, et notamment les services de paiement, nous collectons les donnes suivantes :</p><p><strong>Pour les contributeurs :</strong></p><p>&nbsp;</p><ul><li><strong>informations permettant votre identification</strong>&nbsp;lors de louverture de votre compte ou de la ralisation dun paiement : nom, prnom, adresse e-mail, adresse postale, nationalit, date de naissance ;</li><li><strong>toutes informations strictement rserves  la bonne excution de nos activits (taille de maillot, taille pour les batons, )</strong></li></ul><hr><p><i><strong>1.2  Information que nous collectons automatiquement lors de votre utilisation du site</strong></i></p><p>&nbsp;</p><p style=\"margin-left:0px;\">Lors de votre utilisation du site pour la bonne excution des services, nous sommes galement susceptibles de collecter des donnes  caractre personnel vous concernant, de manire automatique par lintermdiaire des outils et services proposs sur le site</p><p><i><strong>2  Objet de la prsente charte</strong></i></p><p>&nbsp;</p><p style=\"margin-left:0px;\">La prsente charte a pour objet de vous informer sur les moyens que nous mettons en uvre pour collecter et traiter vos donnes  caractre personnel, dans le respect le plus strict de vos droits.</p><p style=\"margin-left:0px;\">Nous vous indiquons  ce sujet que nous nous conformons, dans la collecte et la gestion de vos donnes  caractre personnel,  la loi n 78-17 du 6 janvier 1978 relative  linformatique, aux fichiers et aux liberts, dans sa version actuelle, ainsi quau Rglement gnral de protection des donnes (ci-aprs <i>RGPD</i>).</p><p><i><strong>3  Identit du responsable de la collecte et du traitement de donnes</strong></i></p><p>&nbsp;</p><p style=\"margin-left:0px;\">Le responsable de la collecte et du traitement de vos donnes  caractre personnel est lassociation Amicale du Val de Somme, association sportive&nbsp;<span style=\"color:rgb(0,0,0);\"> 12 RUE FREDERIC PETIT 80000 AMIENS enregistr sous le numros</span> SIRET 44783557000014</p><p><i><strong>4  Collecte et traitement des donnes  caractre personnel</strong></i></p><p>&nbsp;</p><p style=\"margin-left:0px;\">Vos donnes  caractre personnel sont collectes et traites pour rpondre  une ou plusieurs des finalits suivantes :</p><ul><li>Grer votre accs sur le site et aux services accessibles et leur utilisation, ainsi que rpondre  toute demande concernant votre utilisation des services,</li><li>Effectuer les oprations relatives  la gestion et au suivi de nos relations avec les utilisateurs, Organisme FFA</li><li>Constituer un fichier de membres inscrits</li><li>Adresser des newsletters ou tous messages informatifs relatifs  notre actualit. Dans le cas o vous ne le souhaiteriez pas, nous vous donnons la facult dexprimer votre refus  ce sujet lors de la collecte de vos donnes ;</li><li>Respecter nos obligations lgales et rglementaires, notamment en matire de lutte contre la fraude bancaire. A ce titre, nous avons notamment lobligation de vrifier ou dauthentifier vos informations collectes lors des oprations