ong>Concernant les donnes relatives  la gestion et au suivi des relations avec les utilisateurs de nos services :</strong></p><p>&nbsp;</p><p style=\"margin-left:0px;\">Vos donnes  caractre personnel ne seront pas conserves au-del de la dure strictement ncessaire  la gestion de notre relation avec vous. Toutefois, les donnes permettant dtablir la preuve dun droit ou dun contrat, devant tre conserves au titre du respect dune obligation lgale, le seront pendant la dure prvue par la loi en vigueur.</p><p style=\"margin-left:0px;\">Nous conservons vos donnes pendant un dlai maximum de trois (3) ans  compter de la collecte de vos donnes ou du dernier contact manant de lutilisateur ou de la fermeture de votre compte.</p><p><strong>Concernant la gestion des listes dopposition  recevoir de la prospection :</strong></p><p>&nbsp;</p><p style=\"margin-left:0px;\">Les informations permettant de prendre en compte votre droit dopposition sont conserves au minimum trois (3) ans  compter de lexercice du droit dopposition.</p><p><strong>Concernant les statistiques de mesure daudience :</strong></p><p>&nbsp;</p><p style=\"margin-left:0px;\">Les informations stockes dans le terminal des utilisateurs ou tout autre lment utilis pour identifier les utilisateurs et permettant leur traabilit ou frquentation ne seront pas conserves au-del de treize (13) mois.</p><p><strong>Concernant larchivage des donnes relatives aux oprations bancaires :</strong></p><p>&nbsp;</p><p style=\"margin-left:0px;\">A lissue de la dure de conservation de vos donnes telle que prcise ci-dessus, nous vous informons que nous archivons vos donnes pendant un dlai de deux (2) ans pour rpondre  nos obligations lgales, notamment en termes de lutte contre la fraude bancaire et le blanchiment dargent.</p><p><i><strong>8  Scurit</strong></i></p><p>&nbsp;</p><p style=\"margin-left:0px;\">Nous vous informons prendre toutes prcautions utiles, mesures organisationnelles et techniques appropries pour prserver la scurit, lintgrit et la confidentialit de vos donnes  caractre personnel et notamment, empcher quelles soient dformes, endommages ou que des tiers non autoriss y aient accs.</p><p><i><strong>9  Hbergement</strong></i></p><p>&nbsp;</p><p style=\"margin-left:0px;\">Nous vous informons que vos donnes sont conserves et stockes, pendant toute la dure de leur conservation</p><p style=\"margin-left:0px;\">Vos donnes ne feront lobjet daucun transfert en dehors de lUnion europenne dans le cadre de lutilisation des services que nous vous proposons.</p><p><i><strong>10  Cookies</strong></i></p><p>&nbsp;</p><p style=\"margin-left:0px;\">Les cookies sont des fichiers textes, souvent crypts, stocks dans votre navigateur. Ils sont crs lorsque le navigateur dun utilisateur charge un site internet donn : le site envoie des informations au navigateur, qui cre alors un fichier texte. Chaque fois que lutilisateur revient sur le mme site, le navigateur rcupre ce fichier et lenvoie au serveur du site internet.</p><p style=\"margin-left:0px;\">On peut distinguer trois types de cookies, qui nont pas les mmes finalits : les cookies techniques, les cookies des rseaux sociaux et les cookies publicitaires :</p><ul><li>Les cookies techniques sont utiliss tout au long de votre navigation, afin de la faciliter et dexcuter certaines fonctions. Un cookie technique peut par exemple tre utilis pour mmoriser les rponses renseignes dans un formulaire ou encore les prfrences de lutilisateur sagissant de la langue ou de la prsentation dun site internet, lorsque de telles options sont disponibles.</li><li>Les cookies des rseaux sociaux peuvent tre crs par les plateformes sociales pour permettre aux concepteurs de sites internet de partager le contenu de leur site sur lesdites plateformes. Ces cookies peuvent notamment tre utiliss par les plateformes sociales pour tracer la navigation des internautes sur le site internet concern, quils utilisent ou non ces cookies.</li><li>Les cookies publicitaires peuvent tre crs non seulement par le site internet sur lequel lutilisateur navigue, mais galement par dautres sites internet diffusant des publicits, annonces, widgets ou autres lments sur la page affiche. Ces cookies peuvent notamment tre utiliss pour effectuer de la publicit cible, cest--dire de la publicit dtermine en fonction de la navigation de lutilisateur.</li></ul><p style=\"margin-left:0px;\">Nous utilisons des cookies techniques. Ceux-ci sont stocks dans votre navigateur pour une priode de treize (13) mois.</p><p style=\"margin-left:0px;\">Nous utilisons des cookies des rseaux sociaux. Ces cookies ne sont dposs que si vous donnez votre accord. Vous pouvez vous informer sur leur nature, les accepter ou les refuser.</p><p style=\"margin-left:0px;\">Nous vous invitons par ailleurs  consulter les politiques de protection de la vie prive des plateformes sociales  lorigine de ces cookies, pour prendre connaissance des finalits dutilisation des informations de navigation quelles peuvent recueillir grce  ces cookies et des modalits dexercice de vos droits auprs de ces plateformes.</p><p style=\"margin-left:0px;\">Nous utilisons galement des cookies publicitaires. Ces cookies ne sont dposs que si vous donnez votre accord. Vous avez la possibilit de dsactiver ces cookies dans les paramtres de votre navigateur web.</p><p style=\"margin-left:0px;\">Nous utilisons Google Analytics, qui est un outil statistique danalyse daudience qui gnre des cookies permettant de mesurer le nombre de visites sur la Plateforme, le nombre de pages vues et lactivit des visiteurs. Votre adresse IP est galement collecte pour dterminer la ville depuis laquelle vous vous connectez. La dure de conservation de ce cookie est mentionne  larticle 7 (v) de la prsente charte.</p><p style=\"margin-left:0px;\">Nous vous rappelons  toutes fins utiles quil vous est possible de vous opposer au dpt de cookies techniques et des cookies gnrs par Google Analytics, en configurant votre navigateur. Un tel refus pourrait toutefois empcher le bon fonctionnement de la Plateforme.</p><p><i><strong>11  Consentement</strong></i></p><p>&nbsp;</p><p style=\"margin-left:0px;\">Lorsque vous choisissez de communiquer vos donnes  caractre personnel aux fins de lexcution des services que nous proposons par lintermdiaire de notre site, vous donnez expressment votre consentement pour la collecte et le traitement de celles-ci conformment  ce qui est nonc  la prsente charte et  la lgislation en vigueur.</p><p><i><strong>12  Accs  vos donnes  caractre personnel</strong></i></p><p>&nbsp;</p><p style=\"margin-left:0px;\">Conformment  la loi n 78-17 du 6 janvier 1978 relative  linformatique, aux fichiers et aux liberts, ainsi que de RGPD, vous disposez du droit daccder  vos donnes (article 15 du RGPD) pour en obtenir la communication et le cas chant en obtenir, la rectification ou leffacement (articles 16 et 17 du RGPD),  travers un accs en ligne  votre dossier. Vous pouvez galement vous adresser  :</p><ul><li>adresse de courrier lectronique :&nbsp;contact@valdesomme.net</li><li>adresse de courrier postal : <span style=\"color:rgb(0,0,0);\">ESPRIT RUN, 12 RUE FREDERIC PETIT 80000 AMIENS</span></li></ul><p style=\"margin-left:0px;\">Il est rappel que toute personne peut, pour des motifs lgitimes, demander la limitation au traitement des donnes la concernant (article 18 du RGPD) ou sopposer audit traitement (articles 21 et 22 du RGPD).</p><p style=\"margin-left:0px;\">Nous vous informerons quen cas de rectification ou effacement de vos donnes  caractre personnel, ainsi que de limitation des traitements, raliss suite  une demande de votre part, nous notifierons lesdites modifications aux personnes auxquelles nous avons communiqus vos donnes,  moins quune telle communication savre impossible (article 19 du RGPD).</p><p><i><strong>13  Portabilit de vos donnes  caractre personnel</strong></i></p><p>&nbsp;</p><p style=\"margin-left:0px;\">Vous disposez dun droit  la portabilit des donnes  caractre personnel que vous nous aurez fournies, entendues comme les donnes que vous avez dclares activement et consciemment dans le cadre de laccs et de lutilisation des services, ainsi que des donnes gnres par votre activit dans le cadre de lutilisation des services (article 20 du RGPD). Nous vous rappelons que ce droit ne porte pas sur les donnes collectes et traites sur une autre base lgale que le consentement ou lexcution du contrat nous liant.</p><p style=\"margin-left:0px;\">Ce droit peut tre exerc gratuitement,  tout moment, et notamment lors de la fermeture de votre compte, afin de rcuprer et de conserver vos donnes  caractre personnel.</p><p style=\"margin-left:0px;\">Dans ce cadre, nous vous adresserons vos donnes  caractre personnel, par tous moyens jugs utiles, dans un format ouvert standard couramment utilis et lisible par machine, conformment  ltat de lart.</p><p><i><strong>14  Introduction dune rclamation devant une autorit de contrle</strong></i></p><p>&nbsp;</p><p style=\"margin-left:0px;\">Vous tes galement informs que vous disposez du droit dintroduire une rclamation auprs dune autorit de contrle comptente, (la Commission Nationale Informatique et Liberts pour la France), dans lEtat membre dans lequel se trouve votre rsidence habituelle, votre lieu de travail ou le lieu o la violation de vos droits aurait t commise, si vous considrez que le traitement de vos donnes  caractre personnel objet de la prsente Charte constitue une violation des textes applicables.</p><p style=\"margin-left:0px;\">Ce recours pourra tre exerc sans prjudice de tout autre recours devant une juridiction administrative ou juridictionnelle. En effet, vous disposez galement dun droit  un recours administratif ou juridictionnel effectif si vous considrez que le traitement de vos donnes  caractre personnel objet de la prsente Charte constitue une violation des textes applicables.</p><p><i><strong>15  Communication relative  une violation de donnes  caractre personnel</strong></i></p><p>&nbsp;</p><p style=\"margin-left:0px;\">Si nous constatons une faille de scurit dans le traitement de vos donnes susceptibles dentraner un risque lev pour vos droits et liberts, nous vous en informerons dans les meilleurs dlais (article 34 du RGPD). Nous vous dtaillerons  cette occasion la nature de la violation rencontre et les mesures mise en place pour y mettre un terme.</p><p><i><strong>16  Modifications</strong></i></p><p>&nbsp;</p><p style=\"margin-left:0px;\">Nous nous rservons le droit,  notre seule discrtion, de modifier  tout moment la prsente charte, en totalit ou en partie. Ces modifications entreront en vigueur  compter de la publication de la nouvelle charte. Votre utilisation de la Plateforme suite  lentre en vigueur de ces modifications vaudra reconnaissance et acceptation de la nouvelle charte. A dfaut et si cette nouvelle charte ne vous convient pas, vous ne devrez plus accder  la Plateforme.</p><p><i><strong>17  Entre en vigueur</strong></i></p><p>&nbsp;</p><p style=\"margin-left:0px;\">La prsente charte est entre en vigueur le&nbsp;<strong>24 Mai 2018</strong>.</p>');
